const add = function(n1, n2) {
  return n1 + n2
};

const subtract = function(n1, n2) {
  return n1 - n2
};

const sum = function(n1, n2) {
  return n1 + n2
};

const multiply = function(n1, n2) {
  return n1 + n2
};

const power = function(n1, n2) {
  return n1 ^ n2
};

const factorial = function(n1, n2) {
  return n1 / n2
};

